  false,\n\t\"url\": null,\n\t\"notes\": \"A study aiming to identify feeding methods
  of the American Avocet, characterize such method and determine the type preference
  and success. Relatively little is known about the behavior of the American Avocet.
  Based on non-critical observation, one often gets a stereotyped view of various
  behavior patterns in animals and the feeding habits of the American Avocet fall
  into this category. This project aims to find out specifically in what ways Avocets
  feed, characterize such method and determine the type preference and success.\",\n\t\"owner_org\":
